import React,{Component} from 'react';
class Cpright extends React.Component{
	constructor(props){
		super(props)

	}
render(){
	return(
		<div >
		<p className="footer"> Copyright 2020 Â© Cyber Intelligence House</p>
		
		<style jsx>{`
			.footer{
					display:flex;
					flex-direction:column;
					align-item:flex-end;
					background:pink;
			}



			`}</style>
		</div>
		);


}
}

export default Cpright;
